INSERT INTO `Question` (`id`, `agenda`, `question`, `question2`, `manual`, `year`, `term`, `type`, `short`) VALUES
(1, 3, 'พิจารณาอนุมัติงบดุลและบัญชีกำไรขาดทุนของบริษัทสิ้นสุดวันที่ 31 ธันวาคม 2549 ซึ่งผ่านการตรวจสอบจากผู้สอบบัญชี', '', 0, '2008', '1', '1', ''),
(2, 4, 'พิจารณาอนุมัติการจัดสรรเงินกำไรประจำปีของบริษัท', '', 0, '2008', '1', '1', ''),
(3, 5, 'พิจารณาเลือกตั้งกรรมการแทนกรรมการที่ออกตามวาระ พร้อมกำหนดค่าตอบแทนกรรมการประจำปี 2550', '', 0, '2008', '1', '1', ''),
(4, 6, 'พิจารณาเลือกตั้งคณะกรรมการแทนกรรมการที่ออกตามวาระ นายทวีศักดิ์ กออนันตกูล', '', 0, '2008', '1', '1', ''),
(5, 6, 'พิจารณาเลือกตั้งคณะกรรมการแทนกรรมการที่ออกตามวาระ นายสหัส ตรีทิพยบุตร', '', 0, '2008', '1', '1', ''),
(6, 6, 'พิจารณาเลือกตั้งคณะกรรมการแทนกรรมการที่ออกตามวาระ นายเศวต สันตานนท์', '', 0, '2008', '1', '1', ''),
(7, 6, 'พิจารณาเลือกตั้งคณะกรรมการแทนกรรมการที่ออกตามวาระ นายตฤณ ตัณฑเศรษฐี', '', 0, '2008', '1', '1', ''),
(8, 7, 'พิจารณาแต่งตั้งผู้สอบบัญชีและกำหนดค่าสอบบัญชีประจำปี 2550', '', 0, '2008', '1', '1', ''),
(9, 8, 'พิจารณาเปลี่ยนแปลงการดำเนินการต่างๆ เกี่ยวกับการจัดสรรหุ้นคงเหลือจากการใช้สิทธิตามใบสำคัญแสดงสิทธิ (INET-WA)', '', 0, '2008', '1', '1', ''),
(10, 2, 'พิจารณารับรองรายงานการประชุมใหญ่สามัญผู้ถือหุ้นประจำปี 2551 วันที่ 28 เมษายน 2551', '', 0, '2009', '1', '1', ''),
(11, 3, 'รับทราบรายงานของคณะกรรมการบริษัท เกี่ยวกับผลการดำเนินงานประจำปี 2551', '', 0, '2009', '1', '1', ''),
(12, 4, 'พิจารณาอนุมัติงบดุลและบัญชีกำไรขาดทุนของบริษัทสิ้นสุด วันที่ 31 ธันวาคม 2551 ซึ่งผ่านการตรวจสอบจากผู้สอบบัญชี', '', 0, '2009', '1', '1', ''),
(13, 5, 'พิจารณาอนุมัติจ่ายเงินปันผลประจำปี 2551 จากกำไรสะสม', '', 0, '2009', '1', '1', ''),
(14, 6, 'พิจารณากำหนดค่าตอบแทนกรรมการประจำปี 2552', '', 0, '2009', '1', '1', ''),
(15, 7, 'พิจารณาแต่งตั้งผู้ตรวจสอบบัญชีและกำหนดค่าสอบบัญชีประจำปี 2552', '', 0, '2009', '1', '1', ''),
(16, 8, 'พิจารณาอนุมัติแก้ไขเพิ่มเติมวัตถุประสงค์ของ บริษัท อินเทอร์เน็ตประเทศไทย จำกัด(มหาชน)', '', 0, '2009', '1', '1', ''),
(17, 9, 'พิจารณาอนุมัติแก้ไขข้อบังคับของบริษัท อินเทอร์เน็ตประเทศไทย จำกัด (มหาชน)', '', 0, '2009', '1', '1', ''),
(18, 6, 'พิจารณาเลือกตั้งกรรมการแทนกรรมการที่ออกตามวาระ นายธีระเมธ พกมณี', '', 0, '2009', '1', '1', ''),
(19, 6, 'พิจารณาเลือกตั้งกรรมการแทนกรรมการที่ออกตามวาระ ศ.ดร.อัจฉรา จันทร์ฉาย', '', 0, '2009', '1', '1', ''),
(20, 6, 'พิจารณาเลือกตั้งกรรมการแทนกรรมการที่ออกตามวาระ นางมรกต กุลธรรมโยธิน', '', 0, '2009', '1', '1', ''),
(21, 6, 'พิจารณาเลือกตั้งกรรมการแทนกรรมการที่ออกตามวาระ นายนพณัฎฐ์ หุตะเจริญ', '', 0, '2009', '1', '1', ''),
(22, 6, 'พิจารณาเลือกตั้งกรรมการเข้าใหม่ นางสาวธันวดี วงศ์ธีรฤทธิ์', '', 0, '2009', '1', '1', ''),
(23, 6, 'พิจารณาเลือกตั้งกรรมการเข้าใหม่ นายอนิรุทธิ์ หิรัญรักษ์', '', 0, '2009', '1', '1', '');
